    // ВСПОМОГАТЕЛЬНЫЕ ФУНКЦИИ

    public function InitMulti()
    {
        $this->isMultiCurlStarted = true;
        $this->isMultiCurlCompleted = false;
        $this->_mcount = 0;
        $this->mcMaster = curl_multi_init();
        $this->_threads = array();
    }

    public function StopMulti()
    {
        $this->isMultiCurlStarted = false;
        $this->_mcount = 0;
        $this->_threads = array();
        $this->_threads_timers = array();
        if (is_resource($this->mcMaster)) {
            curl_multi_close($this->mcMaster);
        }
    }

    public function MultiDo()
    {
        for ($i = 0; $i < count($this->_threads); $i++) {
            $this->_threads_timers[$i] = new Debugger();
            $count_thread = &$this->_threads_timers[$i];
            $count_thread->start(Debugger::LOG_OTAPILIB_TYPE, [
                'arguments' => $this->_threads_params[$i],
                'method' => $this->_threads_methods[$i],
            ]);
        }

        $fails = array();
        $running = false;
        do {
            while (($execrun = curl_multi_exec($this->mcMaster, $running)) == CURLM_CALL_MULTI_PERFORM);
            if ($execrun != CURLM_OK) {
                break;
            }

            // есть завершившийся запрос, получаем информацию о потоке
            while ($done = curl_multi_info_read($this->mcMaster)) {
                $thread_index = array_search($done['handle'], $this->_threads);
                if (CURLE_OK === $done['result']) {
                    // ищем урл страницы по дескриптору потока в массиве заданий
                    // забираем содержимое
                    $this->_threads[$thread_index] = curl_multi_getcontent($done['handle']);
                    // удаляем поток из мультикурла
                    curl_multi_remove_handle($this->mcMaster, $done['handle']);

                    $str = strstr($this->_threads[$thread_index], '<?xml');
                    $simplexml = simplexml_load_string($str);

                    $realTime = (float) $simplexml->RequestTime / 1000;
                    $count_thread = &$this->_threads_timers[$thread_index];
                    $totalTime = $count_thread->end('', [
                        'realTime' => $realTime,
                    ]);
                    General::registerOtapiRequest((string)$simplexml->RequestId, $totalTime * 1000, $this->_threads_methods[$thread_index]);

                } elseif (! isset($fails[$thread_index])) {
                    // Попробуем отправить запрос еще раз
                    $fails[$thread_index] = $thread_index;

                    $method = $this->_threads_methods[$thread_index];
                    $params = $this->_threads_params[$thread_index];
                    $curl = $this->getCurlInstance($method, $params);
                    $curl->init();
                    curl_multi_add_handle($this->mcMaster, $curl->_resource);
                    $this->_threads[$thread_index] = $curl->_resource;
                    $running++;
                }
            }
            // Ждём активности на оставшихся потоках
            if ($running) {
                curl_multi_select($this->mcMaster, $this->curl_timeout);
            }

        } while ($running);

        curl_multi_close($this->mcMaster);

        if ($execrun != CURLM_OK) {
            // Что-то пошло не так, попробуем запросить данные без мультикурла
            $handles = $this->_threads;
            foreach ($handles as $index => $handle) {
                $this->_threads[$index] = curl_exec($handle);
                curl_close($handle);
                usleep(10000);
            }
        }

        $this->isMultiCurlCompleted = true;
        $this->_mcount = 0;
    }

    private function getCurlInstance($method, $params)
    {
        $curl = new Curl($this->_server . $method, $this->curl_timeout, true, 10, false, true, false);

        $referrer = isset($_SERVER['HTTP_HOST']) ? 'http://' . $_SERVER['HTTP_HOST'] . $_SERVER['REQUEST_URI'] : 'localhost';
        $curl->setReferer($referrer);
        $curl->setPost(http_build_query($params, '', '&'));
        if ($this->_proxy) {
            $curl->setProxy($this->_proxy, $this->_proxyauth);
        }

        return $curl;
    }

    /**
     * Обработка POST данных сервера
     * @param string $method Метод для удаленного сервера
     * @param array $params Входные параметры
     * @return simplexml В случае успеха XML класс
     */
    protected function _getData($method, $params = array())
    {
        extract(Plugins::runSerialEvent('onOtapilibBeforeGetData' . $method, array(
            'params' => $params,
        )));

        $this->call_method = $method;

        $debugger = new Debugger();
        $debugger->start(Debugger::LOG_OTAPILIB_TYPE, [
            'startText' => $method,
            'arguments' => $params,
            'method' => $method,
        ]);

        $simplexml = false;
        $this->error_message = '';
        $stat = '';
        $curdir = getcwd();
        chdir(dirname(__FILE__));

        $curl = $this->getCurlInstance($method, $params);
        if ($this->isMultiCurlStarted) {
            if (! $this->isMultiCurlCompleted) {
                $curl->init();
                curl_multi_add_handle($this->mcMaster, $curl->_resource);
                $this->_threads[$this->_mcount] = $curl->_resource;
                $this->_threads_methods[$this->_mcount] = $method;
                //Параметры
                $this->_threads_params[$this->_mcount] = $params;
                $this->_mcount++;
                chdir($curdir);
                return false;
            }
            $cres = true;
        } else {
            $cres = $curl->connect();
        }
        if ($cres) {
            if ($this->isMultiCurlStarted) {
                $str = isset($this->_threads[$this->_mcount]) ? $this->_threads[$this->_mcount] : '';
                $str2 = $str;
                $this->_mcount++;
            } else {
                $str = $curl->__tostring();
                $str2 = $curl->__tostring();
            }
            /* Warning: strpos() expects parameter 1 to be string при отключенном мульти вызове */
            $str = (string)$str;
            /* */
            $headers = trim(substr($str, 0, strpos($str, '<?xml')));
            $str = strstr($str, '<?xml');
            $headers = str_replace(chr(10), '', $headers);
            $headers_ = explode(chr(13), $headers);
            foreach ($headers_ as &$header) {
                $header = explode(': ', $header);
            }
            $headers = array();
            foreach ($headers_ as $header) {
                if (!array_key_exists(0, @$header)) continue;
                if (!array_key_exists(1, @$header)) continue;
                $headers[@$header[0]] = @$header[1];
            }
            $curlinfo = $curl->getInfo();
            foreach ($curlinfo as $param => $value) {
                if (strpos($param, '_time') === false) unset($curlinfo[$param]);
            }
            $simplexml = @simplexml_load_string($str);
            if (!$simplexml) {
                $this->error_message = $str2;
                $additionalText = '<font color="Red"><b>' . $str2 . '</b></font>';
                $realTime = (float) $simplexml->RequestTime / 1000;
                $totalTime = $debugger->end('', [
                    'additionalText' => $additionalText,
                    'realTime' => $realTime,
                ]);
                General::registerOtapiRequest((string)$simplexml->RequestId, $totalTime * 1000, $method);

                chdir($curdir);

                if($this->_error_as_exception){
                    throw new ServiceException((string)$method,$params,$str2, $curl->getHttpStatus(), $this->_server);
                }

                return false;
            }
        } else {
            $this->error_code = 'No response';
            if (isset($curl->_error) && !empty($curl->_error))
            {
                $this->error_code = 'CurlError';
                $this->error_message = $curl->_error;
            } else {
                $this->error_message = 'Connect to services failed. Contact your hosting support.';
            }

            $curlinfo = $curl->getInfo();
            foreach ($curlinfo as $param => $value) {
                if (strpos($param, '_time') === false) unset($curlinfo[$param]);
            }
            //$stat .= print_r($curlinfo, 1);
            if (empty($str)) $str = 'Empty request or timeout';

            $additionalText = '<font color="Red"><b>' . $str . '</b></font>';
            $totalTime = $debugger->end('', [
                'additionalText' => $additionalText,
            ]);
            General::registerOtapiRequest((string)$simplexml->RequestId, $totalTime * 1000, $method);

            chdir($curdir);

            return false;
        }

        chdir($curdir);
        if (isset($simplexml->ErrorCode) && (string)$simplexml->ErrorCode != 'Ok' && (string)$simplexml->ErrorCode != 'BatchError') {

            if($this->_error_as_exception){
                $additionalText = '<font color="Red"><b>'.(string)$simplexml->ErrorDescription . ' (' . (string)$simplexml->SubErrorCode . ')</b></font>';
                $realTime = (float) $simplexml->RequestTime / 1000;
                $totalTime = $debugger->end('', [
                    'additionalText' => $additionalText,
                    'realTime' => $realTime,
                ]);
                General::registerOtapiRequest((string)$simplexml->RequestId, $totalTime * 1000, $method);

                throw new ServiceException((string)$method,$params,(string)$simplexml->ErrorDescription, (string)$simplexml->ErrorCode, $this->_server, (string)$simplexml->SubErrorCode);
            }

            if ((string)$simplexml->ErrorCode == 'SessionExpired') {
                $this->error_message = 'SessionExpired';
                Session::clear('sid');
                return false;
                //header('Location: index.php?expired');
                //die;
            }
            $this->error_message = $simplexml->ErrorDescription;
            $this->error_code = $simplexml->ErrorCode;
            $additionalText = '<font color="Red"><b>' . $this->error_message . '</b></font>';
            $realTime = (float) $simplexml->RequestTime / 1000;
            $totalTime = $debugger->end('', [
                'additionalText' => $additionalText,
                'realTime' => $realTime,
            ]);
            General::registerOtapiRequest((string)$simplexml->RequestId, $totalTime * 1000, $method);

            return false;
        }

        if (isset($simplexml->HasTranslateErrors)){
             $stat.= "\n";
             $stat.= '<font color="Red"><b> HasTranslateErrors </b></font>';
             $stat.= "\n";
        }

        if ($this->_error_as_exception && isset($simplexml->HasTranslateErrors)) {
            // TODO: Не надо тут выбрасывать исключение.
            //       Нужно просто не кешиорвать полученные данные.
            //throw new ServiceException((string)$method,$params,'HasTranslateErrors', '666', $this->_server);
        }


        if (isset($headers) && isset($headers['X-Opentao-RequestHandleTime'])) {
            $stat .= 'X-Opentao-RequestHandleTime: ' . $headers['X-Opentao-RequestHandleTime'] . "\n";
        }
        $stat .= (string) $simplexml->RequestTimeStatistic . "\n";

        if (!$this->isMultiCurlStarted) {
            $realTime = (float) $simplexml->RequestTime / 1000;
            $total_time = $debugger->end('', [
                'realTime' => $realTime,
            ]);
            General::registerOtapiRequest((string)$simplexml->RequestId, $total_time * 1000, $method);
        }

        extract(Plugins::runSerialEvent('onOtapilibAfterGetData' . $method, array(
            'params' => $params,
            'simplexml' => $simplexml,
        )));

        return $simplexml;
    }

