    function _parseQuantityRanges($data)
    {
        $ranges = array();
        if (! empty($data->QuantityRanges)) {
            $dta = $data->QuantityRanges->children();
            foreach ($dta as $range) {
                $tmpRange = array();
                $tmpRange['MinQuantity'] = (string) $range->MinQuantity;
                $tmpRange['Price']['OriginalPrice'] = (string) $range->Price->OriginalPrice;
                $tmpRange['Price']['MarginPrice'] = (string) $range->Price->MarginPrice;
                $tmpRange['Price']['ConvertedPrice'] = (string) $range->Price->ConvertedPrice;
                $tmpRange['Price']['ConvertedPriceWithoutSign'] = (string) $range->Price->ConvertedPriceWithoutSign;
                $tmpRange['Price']['CurrencySign'] = (string) $range->Price->CurrencySign;
                $tmpRange['Price']['CurrencyName'] = (string) $range->Price->CurrencyName;
                $tmpRange['Price']['IsDeliverable'] = (string) $range->Price->IsDeliverable;

                if (isset($range->Price->ConvertedPriceList->DisplayedMoneys)) {
                    $tmpRange['Price']['ConvertedPriceList'] = array();
                    $arPrices = array();
                    $prices = $range->Price->ConvertedPriceList->DisplayedMoneys->children();
                    foreach ($prices as $k) {
                        $arPrices[] = array(
                            'Sign' => (string) $k['Sign'],
                            'Code' => (string) $k['Code'],
                            'Val' => (string) $k[0]
                        );
                    }
                    $tmpRange['Price']['ConvertedPriceList'] = $arPrices;
                }

                if (isset($range->Price->DeliveryPrice->ConvertedPriceList->DisplayedMoneys)) {
                    $tmpRange['Price']['DeliveryPrice'] = array();
                    $arPrices = array();
                    $prices = $range->Price->DeliveryPrice->ConvertedPriceList->DisplayedMoneys->children();
                    foreach ($prices as $k) {
                        $arPrices[] = array(
                            'Sign' => (string) $k['Sign'],
                            'Code' => (string) $k['Code'],
                            'Val' => (string) $k[0]
                        );
                    }
                    $tmpRange['Price']['DeliveryPrice'] = $arPrices;
                }

                if (isset($range->Price->OneItemDeliveryPrice->ConvertedPriceList->DisplayedMoneys)) {
                    $tmpRange['Price']['OneItemDeliveryPrice'] = array();
                    $arPrices = array();
                    $prices = $range->Price->OneItemDeliveryPrice->ConvertedPriceList->DisplayedMoneys->children();
                    foreach ($prices as $k) {
                        $arPrices[] = array(
                            'Sign' => (string) $k['Sign'],
                            'Code' => (string) $k['Code'],
                            'Val' => (string) $k[0]
                        );
                    }
                    $tmpRange['Price']['OneItemDeliveryPrice'] = $arPrices;
                }

                if (isset($range->Price->OneItemPriceWithoutDelivery->ConvertedPriceList->DisplayedMoneys)) {
                    $tmpRange['Price']['OneItemPriceWithoutDelivery'] = array();
                    $arPrices = array();
                    $prices = $range->Price->OneItemPriceWithoutDelivery->ConvertedPriceList->DisplayedMoneys->children();
                    foreach ($prices as $k) {
                        $arPrices[] = array(
                            'Sign' => (string) $k['Sign'],
                            'Code' => (string) $k['Code'],
                            'Val' => (string) $k[0]
                        );
                    }
                    $tmpRange['Price']['OneItemPriceWithoutDelivery'] = $arPrices;
                }

                if (isset($range->Price->PriceWithoutDelivery->ConvertedPriceList->DisplayedMoneys)) {
                    $tmpRange['Price']['PriceWithoutDelivery'] = array();
                    $arPrices = array();
                    $prices = $range->Price->PriceWithoutDelivery->ConvertedPriceList->DisplayedMoneys->children();
                    foreach ($prices as $k) {
                        $arPrices[] = array(
                            'Sign' => (string) $k['Sign'],
                            'Code' => (string) $k['Code'],
                            'Val' => (string) $k[0]
                        );
                    }
                    $tmpRange['Price']['PriceWithoutDelivery'] = $arPrices;
                }

                if (isset($range->Price->PriceWithoutDiscount->ConvertedPriceList->DisplayedMoneys)) {
                    $tmpRange['Price']['PriceWithoutDiscount'] = array();
                    $arPrices = array();
                    $prices = $range->Price->PriceWithoutDiscount->ConvertedPriceList->DisplayedMoneys->children();
                    foreach ($prices as $k) {
                        $arPrices[] = array(
                            'Sign' => (string) $k['Sign'],
                            'Code' => (string) $k['Code'],
                            'Val' => (string) $k[0]
                        );
                    }
                    $tmpRange['Price']['PriceWithoutDiscount'] = $arPrices;
                }

                if (isset($range->Price->PriceWithoutDiscountAndDelivery->ConvertedPriceList->DisplayedMoneys)) {
                    $tmpRange['Price']['PriceWithoutDiscountAndDelivery'] = array();
                    $arPrices = array();
                    $prices = $range->Price->PriceWithoutDiscountAndDelivery->ConvertedPriceList->DisplayedMoneys->children();
                    foreach ($prices as $k) {
                        $arPrices[] = array(
                            'Sign' => (string) $k['Sign'],
