                            'Val' => (string) $k[0]
                        );
                    }
                    $tmpRange['Price']['PriceWithoutDiscountAndDelivery'] = $arPrices;
                }

                $ranges[] = $tmpRange;
            }
        }
        return $ranges;
    }

