    /**
     * Данные по умолчанию для подключения к сервису
     * @return array $params
     */
    protected function defaultLogin($instanceKey = '') {
        if ($this->useAdminLang) {
           $lang = Session::getActiveAdminLang();
        } else {
            $lang = Session::getActiveLang() ? Session::getActiveLang() : 'en';
        }
        $params = array(
            'instanceKey' => $instanceKey ? $instanceKey : $this->instanceKey,
            'language'    => $lang
        );
        if (OTBase::onFullDebug()) {
            $params['debug'] = 'true'; // дебаг информация отсутствует, если отсутствует данный параметр
        }
        return $params;
    }

    /**
     * Добавляет параметры для подписи
     * @param string $params
     * @return array $params
     */
    protected function checkSecret($params) {
        if (defined('CFG_SERVICE_SECRET')) {
            $trace = debug_backtrace();
            $methodName = isset($trace[1]['function']) ? $trace[1]['function'] : false;

            if ($methodName) {
                $params = array_filter($params, function($v) {
                    return !is_array($v);
                });
                $params['timestamp'] = gmdate('YmdHis');

                ksort($params);
                $signature = $methodName . implode('', $params) . CFG_SERVICE_SECRET;
                $signature = hash('sha256', $signature);

                $params['signature'] = $signature;
            }
        }

        return $params;
    }

